INSERT INTO `field_data_field_long_text_html` VALUES ('paragraphs_item','par_long_text',0,18,566,'und',0,'<p><strong>Pitten en zaden</strong>&nbsp;<strong> zijn ongelooflijk gezond. Eet je dagelijks een portie, dan word je minder snel ziek. Want ze barsten van de heilzame voedingsstoffen. Zei iemand superfood? Daar sla je de pit op de kop!</strong></p>\r\n\r\n<p>Vraag jouw bakker naar brood met extra pitten, zoals zonnebloem- of pompoenpitten. Deze smaakbommetjes ontploffen heerlijk in je mond. En zijn bovendien supervoedzaam en -gezond.</p>\r\n','filtered_html'),('paragraphs_item','par_long_text',0,21,568,'und',0,'<p>Rauw of geroosterd, deze pittige bloemzaden smaken heerlijk in brood. Omdat ze veel onverzadigde vetzuren bevatten zijn ze <strong>goed voor de cholesterol</strong>. Bovendien houden ze jouw bloedsuikerspiegel in balans, waardoor je minder snel naar tussendoortjes grijpt.</p>\r\n\r\n<p>Welk arsenaal <strong>vitaminen en mineralen</strong> je binnenkrijgt met een portie zonnebloempitten? Van vitamine B en E tot foliumzuur, calcium, ijzer, mangaan, zink, magnesium, selenium en koper. <strong>Magnesium</strong> maakt je minder nerveus, voorkomt hoofdpijn en verlaagt je bloeddruk. <strong>Selenium</strong> helpt preventief tegen kanker en stimuleert de detox-functie van je lever.</p>\r\n\r\n<p>Onze tip? Haal af en toe een <strong>gezond zonnebloembroodje</strong> in huis.&nbsp;</p>\r\n','filtered_html'),('paragraphs_item','par_long_text',0,26,537,'und',0,'<ul>\r\n	<li>Nulla maximus quis lectus vitae pharetra.</li>\r\n	<li>In venenatis sed quam sed facilisis.</li>\r\n	<li>Praesent in ornare dolor.</li>\r\n	<li>Maecenas vitae diam accumsan, bibendum ligula dignissim, vehicula risus.</li>\r\n</ul>\r\n','filtered_html'),('paragraphs_item','par_long_text',0,30,396,'und',0,'<p><strong>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aliquam id consequat arcu. Duis at vulputate enim. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur r