ijn ongelooflijk gezond. Eet je dagelijks een portie, dan word je minder snel ziek. Want ze barsten van de heilzame voedingsstoffen. Zei iemand superfood? Daar sla je de pit op de kop! </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Vraag jouw bakker naar brood met extra pitten, zoals zonnebloem- of pompoenpitten. Deze smaakbommetjes ontploffen heerlijk in je mond. En zijn bovendien supervoedzaam en -gezond.</p>\r\n','full_html'),('paragraphs_item','par_long_text',0,140,570,'und',0,'<p>Ze verschijnen vooral op het toneel met Halloween. Al schrikt niemand nog van pompoenpitten in brood of slaatjes. Terecht! Want dit eetbare goud is <strong>gigantisch gezond</strong>. Heb je problemen met je blaas of nieren? Pompoenpitten remmen infecties af. Ze helpen algemeen goed tegen schimmels en ontstekingen, bacteriën en virussen. En ze <strong>versterken je immuunsysteem</strong> waardoor je minder snel ziek en vermoeid bent.</p>\r\n\r\n<p>Een hapje pompoenpitten bezorgt je de nodige dosis <strong>vitaminen en mineralen</strong> – denk maar aan vitamine E en B1, fosfor, magnesium, ijzer, koper en zink. <strong>Zink</strong> helpt je cellen groeien, verbetert je slaap en humeur en stimuleert je smaak en geur. Bovendien werkt pompoen rustgevend, dankzij de aanwezigheid van het aminozuur tryptofaan.</p>\r\n\r\n<p>Wil je dus gezond doen? Koop dan eens een <strong>broodje met pompoen</strong>.&nbsp;</p>\r\n','full_html'),('paragraphs_item','par_long_text',0,141,575,'und',0,'<p><em>Bronnen:</em></p>\r\n\r\n<ul>\r\n	<li><a href=\"http://www.leefnugezonder.be/waarom-zijn-pitten-zaden-zo-gezond/\" target=\"_blank\">Waarom zijn pitten en zaden zo gezond</a></li>\r\n	<li><em><a href=\"mens-en-gezondheid.infonu.nl/gezonde-voeding/104342-de-geneeskracht-van-pompoenpitten.html\" target=\"_blank\">De geneeskracht van pompoenpitten</a></em></li>\r\n	<li><em><a href=\"http://mens-en-gezondheid.infonu.nl/gezonde-voeding/98704-de-geneeskracht-van-zonnebloempitten.html\" target=\"_blank\">De geneeskracht van zonnebloempitten</a></em></li>\r\n</ul>\r\n','full_html');
