pompoenpitten in brood of slaatjes. Terecht! Want dit eetbare goud is <strong>gigantisch gezond</strong>. Heb je problemen met je blaas of nieren? Pompoenpitten remmen infecties af. Ze helpen algemeen goed tegen schimmels en ontstekingen, bacteriën en virussen. En ze <strong>versterken je immuunsysteem</strong> waardoor je minder snel ziek en vermoeid bent.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Een hapje pompoenpitten bezorgt je de nodige dosis <strong>vitaminen en mineralen</strong> – denk maar aan vitamine E en B1, fosfor, magnesium, ijzer, koper en zink. <strong>Zink</strong> helpt je cellen groeien, verbetert je slaap en humeur en stimuleert je smaak en geur. Bovendien werkt pompoen rustgevend, dankzij de aanwezigheid van het aminozuur tryptofaan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Wil je dus gezond doen? Koop dan eens een <strong>broodje met pompoen</strong>.&nbsp;</p>\r\n','full_html'),('paragraphs_item','par_long_text',0,140,462,'und',0,'<p>Ze verschijnen vooral op het toneel met Halloween. Al schrikt niemand nog van pompoenpitten in brood of slaatjes. Terecht! Want dit eetbare goud is <strong>gigantisch gezond</strong>. Heb je problemen met je blaas of nieren? Pompoenpitten remmen infecties af. Ze helpen algemeen goed tegen schimmels en ontstekingen, bacteriën en virussen. En ze <strong>versterken je immuunsysteem</strong> waardoor je minder snel ziek en vermoeid bent.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Een hapje pompoenpitten bezorgt je de nodige dosis <strong>vitaminen en mineralen</strong> – denk maar aan vitamine E en B1, fosfor, magnesium, ijzer, koper en zink. <strong>Zink</strong> helpt je cellen groeien, verbetert je slaap en humeur en stimuleert je smaak en geur. Bovendien werkt pompoen rustgevend, dankzij de aanwezigheid van het aminozuur tryptofaan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Wil je dus gezond doen? Koop dan eens een <strong>broodje met pompoen</strong>.&nbsp;</p>\r\n','full_html'),('paragraphs_item','par_long_text',0,140,476,'und',0,'<p>Ze v