fault','If no language is selected, block will show regardless of language.','','7.50'),(3453,'/nl/admin/structure/block/manage/webform/client-block-1/configure','default','Save and translate','','7.50'),(3454,'/nl/admin/structure/block/manage/webform/client-block-1/configure','default','Control when the browser\'s internal cache of the current page should expire. The date must to be an <a href=\"http://www.csgnetwork.com/timerfc1123calc.html\">RFC-1123</a>-compliant date string that is represented in Greenwich Mean Time (GMT), e.g. \'Sun, 11 Sep 2016 14:57:47 GMT\'. Set to \'0\' to stop the page being cached entirely.','','7.50'),(3455,'/nl/admin/structure/block/manage/webform/client-block-1/configure','default','The block configuration has been saved.','','7.50'),(3456,'/nl/admin/structure/block','default','The block settings have been updated.','','7.50'),(3457,'/nl','default','is','','7.50'),(3458,'/nl','default','is not','','7.50'),(3459,'/nl','default','contains','','7.50'),(3460,'/nl','default','does not contain','','7.50'),(3461,'/nl','default','begins with','','7.50'),(3462,'/nl','default','ends with','','7.50'),(3463,'/nl','default','is blank','','7.50'),(3464,'/nl','default','is not blank','','7.50'),(3465,'/nl','default','is equal to','','7.50'),(3466,'/nl','default','is not equal to','','7.50'),(3467,'/nl','default','is less than','','7.50'),(3468,'/nl','default','is less than or equal','','7.50'),(3469,'/nl','default','is greater than','','7.50'),(3470,'/nl','default','is greater than or equal','','7.50'),(3471,'/nl','default','is before','','7.50'),(3472,'/nl','default','is or is before','','7.50'),(3473,'/nl','default','is after','','7.50'),(3474,'/nl','default','is or is after','','7.50'),(3475,'/nl','default','is empty','','7.50'),(3476,'/nl','default','is not empty','','7.50'),(3477,'/nl','default','is on','','7.50'),(3478,'/nl','default','is not on','','7.50'),(3479,'/nl','default','is on or before','','7.50'),(3480,'/nl','default','is on or after','','7.50'),(3481,'/nl','default','is at','','7.50'),(3482,'/nl','default','is not at','','7.50'),(3483,'/nl','default','is at or before','','7.50'),(3484,'/nl','default','is at or after','','7.50'),(3485,'/nl/admin/modules','default','Configure permissions','','7.50'),(3486,'/nl/admin/modules','default','@module (<span class=\"admin-disabled\">disabled</span>)','','7.50'),(3487,'/nl/admin/modules','default','@module (<span class=\"admin-enabled\">enabled</span>)','','7.50'),(3488,'/nl/admin/modules','default','Manages web fonts.','','7.50'),(3489,'/nl/admin/modules','default','Administrative interface for managing fonts.','','7.50'),(3490,'/nl/admin/modules','default','Shows/hides admin menu with the press of a key.','','7.50'),(3491,'/nl/admin/modules','default','Administration and debugging functionality for developers and site builders.','','7.50'),(3492,'/nl/admin/modules','default','The administration menu module provides a dropdown menu arranged for one- or two-click access to most administrative tasks and other common destinations (to users with the proper permissions). Administration menu also displays the number of anonymous and authenticated users, and allows modules to add their own custom menu items. Integration with the menu varies from module to module; the contributed module <a href=\"@drupal\">Devel</a>, for instance, makes strong use of the administration menu module to provide quick access to development tools.','','7.50'),(3493,'/nl/admin/modules','default','The administration menu <a href=\"@settings\">settings page</a> allows you to modify some elements of the menu\'s behavior and appearance. Since the appearance of the menu is dependent on your site theme, substantial customizations require modifications to your site\'s theme and CSS files. See the advanced module README.txt file for more information on theme and CSS customizations.','','7.50'),(3494,'/nl/admin/modules','default','The menu items displayed in the administration menu depend upon the actual permissions of the viewer. First, the administration menu is only displayed to users in roles with the <em>Access administration menu</em> (admin_menu module) permission. Second, a user must be a member of a role with the <em>Access administration pages</em> (system module) permission to view administrative links. And, third, only currently permitted links are displayed; for example, if a user is not a member of a role with the permissions <em>Administer permissions</em> (user module) and <em>Administer users</em> (user module), the <em>User management</em> menu item is not displayed.','','7.50'),(3495,'/nl/admin/modules','default','Provides a dropdown menu to most administrative tasks and other common destinations (to users with the proper permissions).','','7.50'),(3496,'/nl/admin/modules','default','A better Toolbar.','','7.50'),(3497,'/nl/admin/modules','default','Aggregates syndicated content (RSS, RDF, and Atom feeds).','','7.50'),(3498,'/nl/admin/modules','default','Backup the Drupal database and files or migrate them to another environment.','','7.50'),(3499,'/nl/admin/modules','default','Allow the use of checkboxes or radio buttons for exposed Views filters','','7.50'),(3500,'/nl/admin/modules','default','About','','7.50'),(3501,'/nl/admin/modules','default','The Block module allows you to create boxes of content, which are rendered into an area, or region, of one or more pages of a website. The core Seven administration theme, for example, implements the regions \"Content\", \"Help\", \"Dashboard main\", and \"Dashboard sidebar\", and a block may appear in any one of these regions. The <a href=\"@blocks\">Blocks administration page</a> provides a drag-and-drop interface for assigning a block to a region, and for controlling the order of blocks within regions. For more information, see the online handbook entry for <a href=\"@block\">Block module</a>.','','7.50'),(3502,'/nl/admin/modules','default','Uses','','7.50'),(3503,'/nl/admin/modules','default','Positioning content','','7.50'),(3504,'/nl/admin/modules','default','When working with blocks, remember that all themes do <em>not</em> implement the same regions, or display regions in the same way. Blocks are positioned on a per-theme basis. Users with the <em>Administer blocks</em> permission can disable blocks. Disabled blocks are listed on the <a href=\"@blocks\">Blocks administration page</a>, but are not displayed in any region.','','7.50'),(3505,'/nl/admin/modules','default','Controlling visibility','','7.50'),(3506,'/nl/admin/modules','default','Blocks can be configured to be visible only on certain pages, only to users of certain roles, or only on pages displaying certain <a href=\"@content-type\">content types</a>. Administrators can also allow specific blocks to be enabled or disabled by users when they edit their <a href=\"@user\">My account</a> page. Some dynamic blocks, such as those generated by modules, will be displayed only on certain pages.','','7.50'),(3507,'/nl/admin/modules','default','Creating custom blocks','','7.50'),(3508,'/nl/admin/modules','default','Users with the <em>Administer blocks</em> permission can <a href=\"@block-add\">add custom blocks</a>, which are then listed on the <a href=\"@blocks\">Blocks administration page</a>. Once created, custom blocks behave just like default and module-generated blocks.','','7.50'),(3509,'/nl/admin/modules','default','Controls the visual building blocks a page is constructed with. Blocks are boxes of content rendered into an area, or region, of a web page.','','7.50'),(3510,'/nl/admin/modules','default','Allows assigning CSS classes to blocks.','','7.50'),(3511,'/nl/admin/modules','default','Define styles/themes for blocks.','','7.50'),(3512,'/nl/admin/modules','default','This module provides support for multilingual blocks.','','7.50'),(3513,'/nl/admin/modules','default','You can set up a language for a block or define it as translatable:','','7.50'),(3514,'/nl/admin/modules','default','Blocks with a language will be displayed only in pages with that language.','','7.50'),(3515,'/nl/admin/modules','default','Translatable blocks can be translated using the localization interface.','','7.50'),(3516,'/nl/admin/modules','default','To search and translate strings, use the <a href=\"@translate-interface\">translation interface</a> pages.','','7.50'),(3517,'/nl/admin/modules','default','Enables language selector for blocks and optional block translation.','','7.50'),(3518,'/nl/admin/modules','default','Defines a field type for referencing a block from a node.','','7.50'),(3519,'/nl/admin/modules','default','Enables multi-user blogs.','','7.50'),(3520,'/nl/admin/modules','default','Allows users to create and organize related content in an outline.','','7.50'),(3521,'/nl/admin/modules','default','Performs bulk exporting of data objects known about by Chaos tools.','','7.50'),(3522,'/nl/admin/modules','default','Base CAPTCHA module for adding challenges to arbitrary forms.','','7.50'),(3523,'/nl/admin/modules','default','Automatically set (or unset) CAPTCHA challenges to webforms.','','7.50'),(3524,'/nl/admin/modules','default','A library of helpful tools by Merlin of Chaos.','','7.50'),(3525,'/nl/admin/modules','default','Shows how to use the power of Chaos AJAX.','','7.50'),(3526,'/nl/admin/modules','default','@module (<span class=\"admin-missing\">missing</span>)','','7.50'),(3527,'/nl/admin/modules','default','Shows how an external module can provide ctools plugins (for Panels, etc.).','','7.50'),(3528,'/nl/admin/modules','default','Introduction','','7.50'),(3529,'/nl/admin/modules','default','What You See Is What You Get','','7.50'),(3530,'/nl/admin/modules','default','WYSIWYG','','7.50'),(3531,'/nl/admin/modules','default','The CKEditor module allows Drupal to replace textarea fields with CKEditor. CKEditor is an online rich text editor that can be embedded inside web pages. It is a !wysiwyg editor which means that the text edited in it looks as similar as possible to the results end users will see after the document gets published. It brings to the Web popular editing features found in desktop word processors such as Microsoft Word and OpenOffice.org Writer. CKEditor is truly lightweight and does not require any kind of installation on the client computer.','','7.50'),(3532,'/nl/admin/modules','default','CKEditor website','','7.50'),(3533,'/nl/admin/modules','default','CKEditor for Drupal 7 Documentation','','7.50'),(3534,'/nl/admin/modules','default','User\'s Guide','','7.50'),(3535,'/nl/admin/modules','default','Useful links: !ckeditorlink | !devguidelink | !userguidelink.','','7.50'),(3536,'/nl/admin/modules','default','Administration panel','','7.50'),(3537,'/nl/admin/modules','default','Content Authoring','','7.50'),(3538,'/nl/admin/modules','default','CKEditor profiles can be configured in the !adminpath section. Profiles determine which options are available to users based on the input format system.','','7.50'),(3539,'/nl/admin/modules','default','filters','','7.50'),(3540,'/nl/admin/modules','default','For the Rich Text Editing to work you also need to configure your !filterlink for the users that may access Rich Text Editing. Either grant those users <strong>Full HTML</strong> access or use the following list of tags in the HTML filter:','','7.50'),(3541,'/nl/admin/modules','default','README.txt','','7.50'),(3542,'/nl/admin/modules','default','<strong>Note:</strong> be careful when granting users access to create tags like %iframe.<br />If you are going to use CKEditor with the <strong>Filtered HTML</strong> input format, please read the \"Setting up filters\" section in the !readme file.','','7.50'),(3543,'/nl/admin/modules','default','Line break converter','','7.50'),(3544,'/nl/admin/modules','default','To have better control over line breaks, you should disable the <strong>%settingname</strong> setting in the chosen Text format (recommended).','','7.50'),(3545,'/nl/admin/modules','default','API documentation','','7.50'),(3546,'/nl/admin/modules','default','All configuration options described in the !apidocs that cannot be easily changed in the administration area can be set in the <strong>Advanced Options</strong> section in the CKEditor profile.','','7.50'),(3547,'/nl/admin/modules','default','Troubleshooting','','7.50'),(3548,'/nl/admin/modules','default','the list of common problems','','7.50'),(3549,'/nl/admin/modules','default','Take a look at !listlink when installing CKEditor.','','7.50'),(3550,'/nl/admin/modules','default','official project page','','7.50'),(3551,'/nl/admin/modules','default','If you are looking for more information, have any trouble with the configuration, or found an issue with the CKEditor module, please visit the !officiallink.','','7.50'),(3552,'/nl/admin/modules','default','here','','7.50'),(3553,'/nl/admin/modules','default','More information about how to customize CKEditor for your theme can be found !herelink.','','7.50'),(3554,'/nl/admin/modules','default','Plugins: Code Snippet and MathJax','','7.50'),(3555,'/nl/admin/modules','default','Code Snippet and MathJax are special plugins for CKEditor that are using external JavaScript libraries to style content inside editing area. The result that is returned by CKEditor is just an HTML tag that needs to again processed by a filter (either server side or client side) in order to display it properly to the user.','','7.50'),(3556,'/nl/admin/modules','default','MathJax (Mathematical Formulas)','','7.50'),(3557,'/nl/admin/modules','default','With mathjax plugin, CKEditor produces LaTeX code surrounded by !code. In order to have it properly rendered on your site you might need to add !mathjax on your website, the simplest way to do this is to add this to your theme: !script','','7.50'),(3558,'/nl/admin/modules','default','Code Snippet','','7.50'),(3559,'/nl/admin/modules','default','With codesnippet plugin, CKEditor produces code snippets surrounded by !code. <strong>Note:</strong> You might need to add !highlight on your website so that the displayed code was rendered nicely as in CKEditor. The simplest way to do this is to add this to your theme: !script','','7.50'),(3560,'/nl/admin/modules','default','Uploading images and files','','7.50'),(3561,'/nl/admin/modules','default','There are three ways for uploading files:','','7.50'),(3562,'/nl/admin/modules','default','CKFinder','','7.50'),(3563,'/nl/admin/modules','default','By using !ckfinder (commercial), an advanced Ajax file manager.','','7.50'),(3564,'/nl/admin/modules','default','By using a dedicated module like !imcelink.','','7.50'),(3565,'/nl/admin/modules','default','By using the core upload module.','','7.50'),(3566,'/nl/admin/modules','default','Enables CKEditor (WYSIWYG HTML editor) for use instead of plain text fields.','','7.50'),(3567,'/nl/admin/modules','default','The Color module allows users with the <em>Administer site configuration</em> permission to quickly and easily change the color scheme of themes that have been built to be compatible with it. For more information, see the online handbook entry for <a href=\"@color\">Color module</a>.','','7.50'),(3568,'/nl/admin/modules','default','Changing colors','','7.50'),(3569,'/nl/admin/modules','default','Using the Color module allows you to easily change the color of links, backgrounds, text, and other theme elements. To change the color settings for a compatible theme, select the <em>Settings</em> link for your theme on the <a href=\'@configure\'>Themes administration page</a>. If you don\'t see a color picker on that page, then your theme is not compatible with the color module. If you are sure that the theme does indeed support the color module, but the color picker does not appear, then <a href=\'@troubleshoot\'>follow these troubleshooting procedures</a>.','','7.50'),(3570,'/nl/admin/modules','default','The Color module saves a modified copy of the theme\'s specified stylesheets in the files directory. This means that if you make any manual changes to your theme\'s stylesheet, <em>you must save your color settings again, even if they haven\'t changed</em>. This step is required because the module stylesheets (in the files directory) need to be recreated to include your changes.','','7.50'),(3571,'/nl/admin/modules','default','Allows administrators to change the color scheme of compatible themes.','','7.50'),(3572,'/nl/admin/modules','default','Color Field using a hexadecimal notation (HEX)','','7.50'),(3573,'/nl/admin/modules','default','Allows users to comment on and discuss published content.','','7.50'),(3574,'/nl/admin/modules','default','Enables the use of both personal and site-wide contact forms.','','7.50'),(3575,'/nl/admin/modules','default','Makes contact categories and replies available for translation.','','7.50'),(3576,'/nl/admin/modules','default','The Content translation module allows content to be translated into different languages. Working with the <a href=\"@locale\">Locale module</a> (which manages enabled languages and provides translation for the site interface), the Content translation module is key to creating and maintaining translated site content. For more information, see the online handbook entry for <a href=\"@translation\">Content translation module</a>.','','7.50'),(3577,'/nl/admin/modules','default','Configuring content types for translation','','7.50'),(3578,'/nl/admin/modules','default','To configure a particular content type for translation, visit the <a href=\"@content-types\">Content types</a> page, and click the <em>edit</em> link for the content type. In the <em>Publishing options</em> section, select <em>Enabled, with translation</em> under <em>Multilingual support</em>.','','7.50'),(3579,'/nl/admin/modules','default','Assigning a language to content','','7.50'),(3580,'/nl/admin/modules','default','Use the <em>Language</em> drop down to select the appropriate language when creating or editing content.','','7.50'),(3581,'/nl/admin/modules','default','Translating content','','7.50'),(3582,'/nl/admin/modules','default','Users with the <em>translate content</em> permission can translate content, if the content type has been configured to allow translations. To translate content, select the <em>Translation</em> tab when viewing the content, select the language for which you wish to provide content, and then enter the content.','','7.50'),(3583,'/nl/admin/modules','default','Maintaining translations','','7.50'),(3584,'/nl/admin/modules','default','If editing content in one language requires that translated versions also be updated to reflect the change, use the <em>Flag translations as outdated</em> check box to mark the translations as outdated and in need of revision. Individual translations may also be marked for revision by selecting the <em>This translation needs to be updated</em> check box on the translation editing form.','','7.50'),(3585,'/nl/admin/modules','default','Allows content to be translated into different languages.','','7.50'),(3586,'/nl/admin/modules','default','The Contextual links module displays links related to regions of pages on your site to users with <em>access contextual links</em> permission. For more information, see the online handbook entry for <a href=\"@contextual\">Contextual links module</a>.','','7.50'),(3587,'/nl/admin/modules','default','Displaying contextual links','','7.50'),(3588,'/nl/admin/modules','default','Contextual links are supplied by modules, to give you quick access to tasks associated with regions of pages on your site. For instance, if you have a custom menu block displayed in a sidebar of your site, the Blocks and Menus modules will supply links to configure the block and edit the menu. The Contextual links module collects these links into a list for display by your theme, and also adds JavaScript code to the page to hide the links initially, and display them when your mouse hovers over the block.','','7.50'),(3589,'/nl/admin/modules','default','Provides contextual links to perform actions related to elements on a page.','','7.50'),(3590,'/nl/admin/modules','default','Create custom, exportable, reusable content panes for applications like Panels.','','7.50'),(3591,'/nl/admin/modules','default','Create custom, exportable, reusable access rulesets for applications like Panels.','','7.50'),(3592,'/nl/admin/modules','default','The Dashboard module provides a <a href=\"@dashboard\">Dashboard page</a> in the administrative interface for organizing administrative tasks and navigation, and tracking information within your site. The Dashboard page contains blocks, which you can add to and arrange using the drag-and-drop interface that appears when you click on the <em>Customize dashboard</em> link. Within this interface, blocks that are not primarily used for site administration do not appear by default, but can be added via the <em>Add other blocks</em> link. For more information, see the online handbook entry for <a href=\"@handbook\">Dashboard module</a>.','','7.50'),(3593,'/nl/admin/modules','default','Tracking user activity','','7.50'),(3594,'/nl/admin/modules','default','By enabling blocks such as <em>Who\'s online</em> and <em>Who\'s new</em>, site users can track who is logged in and new user signups at a centralized location.','','7.50'),(3595,'/nl/admin/modules','default','Tracking content activity','','7.50'),(3596,'/nl/admin/modules','default','By enabling blocks such as <em>Recent blog posts</em>, <em>New forum topics</em> and <em>Recent comments</em>, site users can view newly added site content at a glance.','','7.50'),(3597,'/nl/admin/modules','default','Provides a dashboard page in the administrative interface for organizing administrative tasks and tracking information within your site.','','7.50'),(3598,'/nl/admin/modules','default','The Database logging module logs system events in the Drupal database. For more information, see the online handbook entry for the <a href=\"@dblog\">Database logging module</a>.','','7.50'),(3599,'/nl/admin/modules','default','Monitoring your site','','7.50'),(3600,'/nl/admin/modules','default','The Database logging module allows you to view an event log on the <a href=\"@dblog\">Recent log messages</a> page. The log is a chronological list of recorded events containing usage data, performance data, errors, warnings and operational information. Administrators should check the log on a regular basis to ensure their site is working properly.','','7.50'),(3601,'/nl/admin/modules','default','Debugging site problems','','7.50'),(3602,'/nl/admin/modules','default','In case of errors or problems with the site, the <a href=\"@dblog\">Recent log messages</a> page can be useful for debugging, since it shows the sequence of events. The log messages include usage information, warnings, and errors.','','7.50'),(3603,'/nl/admin/modules','default','Logs and records system events to the database.','','7.50'),(3604,'/nl/admin/modules','default','Various blocks, pages, and functions for developers.','','7.50'),(3605,'/nl/admin/modules','default','Generate dummy users, nodes, and taxonomy terms.','','7.50'),(3606,'/nl/admin/modules','default','Developer blocks and page illustrating relevant node_access records.','','7.50'),(3607,'/nl/admin/modules','default','Extend the display options for every entity type.','','7.50'),(3608,'/nl/admin/modules','default','Development functionality for Display Suite.','','7.50'),(3609,'/nl/admin/modules','default','Contains additional features for Display Suite.','','7.50'),(3610,'/nl/admin/modules','default','Provides the Display Suite Code format filter.','','7.50'),(3611,'/nl/admin/modules','default','Manage the layout of forms in Display Suite.','','7.50'),(3612,'/nl/admin/modules','default','Extend the display options for search results for Drupal Core or Apache Solr.','','7.50'),(3613,'/nl/admin/modules','default','User interface for managing fields, view modes and classes.','','7.50'),(3614,'/nl/admin/modules','default','@font-your-face provider for Edge Fonts.','','7.50'),(3615,'/nl/admin/modules','default','Enables modules to work with any entity type and to provide entities.','','7.50'),(3616,'/nl/admin/modules','default','Provides token replacements for all properties that have no tokens and are known to the entity API.','','7.50'),(3617,'/nl/admin/modules','default','Implements a jQuery plugin that makes the height of the elements equal.','','7.50'),(3618,'/nl/admin/modules','default','Add elements or CSS classes that you need to be of equal height (with a leading period (\'.\') ) . <br />','','7.50'),(3619,'/nl/admin/modules','default','Note: you can combine multiple selectors, i.e. \"header, .wrapper\".','','7.50'),(3620,'/nl/admin/modules','default','Adds a jQuery plugin to equalize heights for sets of elements.','','7.50'),(3621,'/nl/admin/modules','default','This module aims at making the website compliant with the new EU cookie regulation','','7.50'),(3622,'/nl/admin/modules','default','The Field module allows custom data fields to be defined for <em>entity</em> types (entities include content items, comments, user accounts, and taxonomy terms). The Field module takes care of storing, loading, editing, and rendering field data. Most users will not interact with the Field module directly, but will instead use the <a href=\"@field-ui-help\">Field UI module</a> user interface. Module developers can use the Field API to make new entity types \"fieldable\" and thus allow fields to be attached to them. For more information, see the online handbook entry for <a href=\"@field\">Field module</a>.','','7.50'),(3623,'/nl/admin/modules','default','Enabling field types','','7.50'),(3624,'/nl/admin/modules','default','The Field module provides the infrastructure for fields and field attachment; the field types and input widgets themselves are provided by additional modules. Some of the modules are required; the optional modules can be enabled from the <a href=\"@modules\">Modules administration page</a>. Drupal core includes the following field type modules: Number (required), Text (required), List (required), Taxonomy (optional), Image (optional), and File (optional); the required Options module provides input widgets for other field modules. Additional fields and widgets may be provided by contributed modules, which you can find in the <a href=\"@contrib\">contributed module section of Drupal.org</a>. Currently enabled field and input widget modules:','','7.50'),(3625,'/nl/admin/modules','default','Managing field data storage','','7.50'),(3626,'/nl/admin/modules','default','Developers of field modules can either use the default <a href=\"@sql-store\">Field SQL storage module</a> to store data for their fields, or a contributed or custom module developed using the <a href=\"@storage-api\">field storage API</a>.','','7.50'),(3627,'/nl/admin/modules','default','Field API to add fields to entities like nodes and users.','','7.50'),(3628,'/nl/admin/modules','default','Adds a formatter for text/list/term-reference fields to render as CSS classes on nodes.','','7.50'),(3629,'/nl/admin/modules','default','Provides the ability to group your fields on both form and display.','','7.50'),(3630,'/nl/admin/modules','default','The Field SQL storage module stores field data in the database. It is the default field storage module; other field storage mechanisms may be available as contributed modules. See the <a href=\"@field-help\">Field module help page</a> for more information about fields.','','7.50'),(3631,'/nl/admin/modules','default','Stores field data in an SQL database.','','7.50'),(3632,'/nl/admin/modules','default','Translate field properties','','7.50'),(3633,'/nl/admin/modules','default','The Field UI module provides an administrative user interface (UI) for attaching and managing fields. Fields can be defined at the content-type level for content items and comments, at the vocabulary level for taxonomy terms, and at the site level for user accounts. Other modules may also enable fields to be defined for their data. Field types (text, image, number, etc.) are defined by modules, and collected and managed by the <a href=\"@field\">Field module</a>. For more information, see the online handbook entry for <a href=\"@field_ui\" target=\"_blank\">Field UI module</a>.','','7.50'),(3634,'/nl/admin/modules','default','Planning fields','','7.50'),(3635,'/nl/admin/modules','default','There are several decisions you will need to make before defining a field for content, comments, etc.:','','7.50'),(3636,'/nl/admin/modules','default','What the field will be called','','7.50'),(3637,'/nl/admin/modules','default','A field has a <em>label</em> (the name displayed in the user interface) and a <em>machine name</em> (the name used internally). The label can be changed after you create the field, if needed, but the machine name cannot be changed after you have created the field.','','7.50'),(3638,'/nl/admin/modules','default','What type of data the field will store','','7.50'),(3639,'/nl/admin/modules','default','Each field can store one type of data (text, number, file, etc.). When you define a field, you choose a particular <em>field type</em>, which corresponds to the type of data you want to store. The field type cannot be changed after you have created the field.','','7.50'),(3640,'/nl/admin/modules','default','How the data will be input and displayed','','7.50'),(3641,'/nl/admin/modules','default','Each field type has one or more available <em>widgets</em> associated with it; each widget provides a mechanism for data input when you are editing (text box, select list, file upload, etc.). Each field type also has one or more display options, which determine how the field is displayed to site visitors. The widget and display options can be changed after you have created the field.','','7.50'),(3642,'/nl/admin/modules','default','How many values the field will store','','7.50'),(3643,'/nl/admin/modules','default','You can store one value, a specific maximum number of values, or an unlimited number of values in each field. For example, an employee identification number field might store a single number, whereas a phone number field might store multiple phone numbers. This setting can be changed after you have created the field, but if you reduce the maximum number of values, you may lose information.','','7.50'),(3644,'/nl/admin/modules','default','Reusing fields','','7.50'),(3645,'/nl/admin/modules','default','Once you have defined a field, you can reuse it. For example, if you define a custom image field for one content type, and you need to have an image field with the same parameters on another content type, you can add the same field to the second content type, in the <em>Add existing field</em> area of the user interface. You could also add this field to a taxonomy vocabulary, comments, user accounts, etc.','','7.50'),(3646,'/nl/admin/modules','default','Some settings of a reused field are unique to each use of the field; others are shared across all places you use the field. For example, the label of a text field is unique to each use, while the setting for the number of values is shared.','','7.50'),(3647,'/nl/admin/modules','default','There are two main reasons for reusing fields. First, reusing fields can save you time over defining new fields. Second, reusing fields also allows you to display, filter, group, and sort content together by field across content types. For example, the contributed Views module allows you to create lists and tables of content. So if you use the same field on multiple content types, you can create a View containing all of those content types together displaying that field, sorted by that field, and/or filtered by that field.','','7.50'),(3648,'/nl/admin/modules','default','Fields on content items','','7.50'),(3649,'/nl/admin/modules','default','Fields on content items are defined at the content-type level, on the <em>Manage fields</em> tab of the content type edit page (which you can reach from the <a href=\"@types\">Content types page</a>). When you define a field for a content type, each content item of that type will have that field added to it. Some fields, such as the Title and Body, are provided for you when you create a content type, or are provided on content types created by your installation profile.','','7.50'),(3650,'/nl/admin/modules','default','Fields on taxonomy terms','','7.50'),(3651,'/nl/admin/modules','default','Fields on taxonomy terms are defined at the taxonomy vocabulary level, on the <em>Manage fields</em> tab of the vocabulary edit page (which you can reach from the <a href=\"@taxonomy\">Taxonomy page</a>). When you define a field for a vocabulary, each term in that vocabulary will have that field added to it. For example, you could define an image field for a vocabulary to store an icon with each term.','','7.50'),(3652,'/nl/admin/modules','default','Fields on user accounts','','7.50'),(3653,'/nl/admin/modules','default','Fields on user accounts are defined on a site-wide basis on the <a href=\"@fields\">Manage fields tab</a> of the <a href=\"@accounts\">Account settings</a> page. When you define a field for user accounts, each user account will have that field added to it. For example, you could add a long text field to allow users to include a biography.','','7.50'),(3654,'/nl/admin/modules','default','Fields on comments','','7.50'),(3655,'/nl/admin/modules','default','Fields on comments are defined at the content-type level, on the <em>Comment fields</em> tab of the content type edit page (which you can reach from the <a href=\"@types\">Content types page</a>). When you add a field for comments, each comment on a content item of that type will have that field added to it. For example, you could add a website field to the comments on forum posts, to allow forum commenters to add a link to their website.','','7.50'),(3656,'/nl/admin/modules','default','User interface for the Field API.','','7.50'),(3657,'/nl/admin/modules','default','The File module defines a <em>File</em> field type for the Field module, which lets you manage and validate uploaded files attached to content on your site (see the <a href=\"@field-help\">Field module help page</a> for more information about fields). For more information, see the online handbook entry for <a href=\"@file\">File module</a>.','','7.50'),(3658,'/nl/admin/modules','default','Attaching files to content','','7.50'),(3659,'/nl/admin/modules','default','The File module allows users to attach files to content (e.g., PDF files, spreadsheets, etc.), when a <em>File</em> field is added to a given content type using the <a href=\"@fieldui-help\">Field UI module</a>. You can add validation options to your File field, such as specifying a maximum file size and allowed file extensions.','','7.50'),(3660,'/nl/admin/modules','default','Managing attachment display','','7.50'),(3661,'/nl/admin/modules','default','When you attach a file to content, you can specify whether it is <em>listed</em> or not. Listed files are displayed automatically in a section at the bottom of your content; non-listed files are available for embedding in your content, but are not included in the list at the bottom.','','7.50'),(3662,'/nl/admin/modules','default','Managing file locations','','7.50'),(3663,'/nl/admin/modules','default','When you create a File field, you can specify a directory where the files will be stored, which can be within either the <em>public</em> or <em>private</em> files directory. Files in the public directory can be accessed directly through the web server; when public files are listed, direct links to the files are used, and anyone who knows a file\'s URL can download the file. Files in the private directory are not accessible directly through the web server; when private files are listed, the links are Drupal path requests. This adds to server load and download time, since Drupal must start up and resolve the path for each file download request, but allows for access restrictions.','','7.50'),(3664,'/nl/admin/modules','default','Defines a file field type.','','7.50'),(3665,'/nl/admin/modules','default','The Filter module allows administrators to configure text formats. A text format defines the HTML tags, codes, and other input allowed in content and comments, and is a key feature in guarding against potentially damaging input from malicious users. For more information, see the online handbook entry for <a href=\"@filter\">Filter module</a>.','','7.50'),(3666,'/nl/admin/modules','default','Configuring text formats','','7.50'),(3667,'/nl/admin/modules','default','Configure text formats on the <a href=\"@formats\">Text formats page</a>. <strong>Improper text format configuration is a security risk</strong>. To ensure security, untrusted users should only have access to text formats that restrict them to either plain text or a safe set of HTML tags, since certain HTML tags can allow embedding malicious links or scripts in text. More trusted registered users may be granted permission to use less restrictive text formats in order to create rich content.','','7.50'),(3668,'/nl/admin/modules','default','Applying filters to text','','7.50'),(3669,'/nl/admin/modules','default','Each text format uses filters to manipulate text, and most formats apply several different filters to text in a specific order. Each filter is designed for a specific purpose, and generally either adds, removes, or transforms elements within user-entered text before it is displayed. A filter does not change the actual content, but instead, modifies it temporarily before it is displayed. One filter may remove unapproved HTML tags, while another automatically adds HTML to make URLs display as clickable links.','','7.50'),(3670,'/nl/admin/modules','default','Defining text formats','','7.50'),(3671,'/nl/admin/modules','default','One format is included by default: <em>Plain text</em> (which removes all HTML tags). Additional formats may be created by your installation profile when you install Drupal, and more can be created by an administrator on the <a href=\"@text-formats\">Text formats page</a>.','','7.50'),(3672,'/nl/admin/modules','default','Choosing a text format','','7.50'),(3673,'/nl/admin/modules','default','Users with access to more than one text format can use the <em>Text format</em> fieldset to choose between available text formats when creating or editing multi-line content. Administrators can define the text formats available to each user role, and control the order of formats listed in the <em>Text format</em> fieldset on the <a href=\"@text-formats\">Text formats page</a>.','','7.50'),(3674,'/nl/admin/modules','default','Filters content in preparation for display.','','7.50'),(3675,'/nl/admin/modules','default','Defines a field type for referencing a font from a node.','','7.50'),(3676,'/nl/admin/modules','default','@font-your-face provider with Font Squirrel fonts.','','7.50'),(3677,'/nl/admin/modules','default','@font-your-face provider of fonts from Fontdeck.com.','','7.50'),(3678,'/nl/admin/modules','default','@font-your-face provider of fonts from Fonts.com.','','7.50'),(3679,'/nl/admin/modules','default','Provides discussion forums.','','7.50'),(3680,'/nl/admin/modules','default','Searches for an alias of the current URL and 301 redirects if found. Stops duplicate content arising when path module is enabled.','','7.50'),(3681,'/nl/admin/modules','default','Views plugins to show Google Maps from entities.','','7.50'),(3682,'/nl/admin/modules','default','GMap field types, currently only a marker field.','','7.50'),(3683,'/nl/admin/modules','default','Display location.module information on Google Maps','','7.50'),(3684,'/nl/admin/modules','default','UI for building GMap macros.','','7.50'),(3685,'/nl/admin/modules','default','A module that lets you add more styles to your gmap popup bubbles.','','7.50'),(3686,'/nl/admin/modules','default','Taxonomy based markers','','7.50'),(3687,'/nl/admin/modules','default','Allows your site to be tracked by Google Analytics by adding a Javascript tracking code to every page.','','7.50'),(3688,'/nl/admin/modules','default','@font-your-face provider with Google fonts.','','7.50'),(3689,'/nl/admin/modules','default','The Help module provides <a href=\"@help-page\">Help reference pages</a> and context-sensitive advice to guide you through the use and configuration of modules. It is a starting point for the online <a href=\"@handbook\">Drupal handbooks</a>. The handbooks contain more extensive and up-to-date information, are annotated with user-contributed comments, and serve as the definitive reference point for all Drupal documentation. For more information, see the online handbook entry for the <a href=\"@help\">Help module</a>.','','7.50'),(3690,'/nl/admin/modules','default','Providing a help reference','','7.50'),(3691,'/nl/admin/modules','default','The Help module displays explanations for using each module listed on the main <a href=\"@help\">Help reference page</a>.','','7.50'),(3692,'/nl/admin/modules','default','Providing context-sensitive help','','7.50'),(3693,'/nl/admin/modules','default','The Help module displays context-sensitive advice and explanations on various pages.','','7.50'),(3694,'/nl/admin/modules','default','Manages the display of online help.','','7.50'),(3695,'/nl/admin/modules','default','The Image module allows you to manipulate images on your website. It exposes a setting for using the <em>Image toolkit</em>, allows you to configure <em>Image styles</em> that can be used for resizing or adjusting images on display, and provides an <em>Image</em> field for attaching images to content. For more information, see the online handbook entry for <a href=\"@image\">Image module</a>.','','7.50'),(3696,'/nl/admin/modules','default','Manipulating images','','7.50'),(3697,'/nl/admin/modules','default','With the Image module you can scale, crop, resize, rotate and desaturate images without affecting the original image using <a href=\"@image\">image styles</a>. When you change an image style, the module automatically refreshes all created images. Every image style must have a name, which will be used in the URL of the generated images. There are two common approaches to naming image styles (which you use will depend on how the image style is being applied):','','7.50'),(3698,'/nl/admin/modules','default','Based on where it will be used: eg. <em>profile-picture</em>','','7.50'),(3699,'/nl/admin/modules','default','Describing its appearance: eg. <em>square-85x85</em>','','7.50'),(3700,'/nl/admin/modules','default','After you create an image style, you can add effects: crop, scale, resize, rotate, and desaturate (other contributed modules provide additional effects). For example, by combining effects as crop, scale, and desaturate, you can create square, grayscale thumbnails.','','7.50'),(3701,'/nl/admin/modules','default','Attaching images to content as fields','','7.50'),(3702,'/nl/admin/modules','default','Image module also allows you to attach images to content as fields. To add an image field to a <a href=\'@content-type\'>content type</a>, go to the content type\'s <em>manage fields</em> page, and add a new field of type <em>Image</em>. Attaching images to content this way allows image styles to be applied and maintained, and also allows you more flexibility when theming.','','7.50'),(3703,'/nl/admin/modules','default','Provides image manipulation tools.','','7.50'),(3704,'/nl/admin/modules','default','Provides an image based CAPTCHA challenge.','','7.50'),(3705,'/nl/admin/modules','default','Add an URL formatter for image field','','7.50'),(3706,'/nl/admin/modules','default','An image/file uploader and browser supporting personal directories and user quota.','','7.50'),(3707,'/nl/admin/modules','default','This module improves support for multilingual content in Drupal sites:','','7.50'),(3708,'/nl/admin/modules','default','Shows content depending on page language.','','7.50'),(3709,'/nl/admin/modules','default','Handles multilingual variables.','','7.50'),(3710,'/nl/admin/modules','default','Extended language option for chosen content types. For these content types transations will be allowed for all defined languages, not only for enabled ones.','','7.50'),(3711,'/nl/admin/modules','default','Provides a block for language selection and two theme functions: <em>i18n_flags</em> and <em>i18n_links</em>.','','7.50'),(3712,'/nl/admin/modules','default','This is the base module for several others adding different features:','','7.50'),(3713,'/nl/admin/modules','default','Multilingual menu items.','','7.50'),(3714,'/nl/admin/modules','default','Multilingual taxonomy adds a language field for taxonomy vocabularies and terms.','','7.50'),(3715,'/nl/admin/modules','default','For more information, see the online handbook entry for <a href=\"@i18n\">Internationalization module</a>.','','7.50'),(3716,'/nl/admin/modules','default','Extends Drupal support for multilingual features.','','7.50'),(3717,'/nl/admin/modules','default','Update jQuery and jQuery UI to a more recent version.','','7.50'),(3718,'/nl/admin/modules','default','Add jQuery Waypoints plugin to the site','','7.50'),(3719,'/nl/admin/modules','default','Allows version-dependent and shared usage of external libraries.','','7.50'),(3720,'/nl/admin/modules','default','Defines simple link field types.','','7.50'),(3721,'/nl/admin/modules','default','The List module defines various fields for storing a list of items, for use with the Field module. Usually these items are entered through a select list, checkboxes, or radio buttons. See the <a href=\"@field-help\">Field module help page</a> for more information about fields.','','7.50'),(3722,'/nl/admin/modules','default','Defines list field types. Use with Options to create selection lists.','','7.50'),(3723,'/nl/admin/modules','default','@font-your-face provider with fonts installed locally on the Drupal server.','','7.50'),(3724,'/nl/admin/modules','default','The Locale module allows your Drupal site to be presented in languages other than the default English, and to be multilingual. The Locale module works by maintaining a database of translations, and examining text as it is about to be displayed. When a translation of the text is available in the language to be displayed, the translation is displayed rather than the original text. When a translation is unavailable, the original text is displayed, and then stored for review by a translator. For more information, see the online handbook entry for <a href=\"@locale\">Locale module</a>.','','7.50'),(3725,'/nl/admin/modules','default','Translating interface text','','7.50'),(3726,'/nl/admin/modules','default','Translations of text in the Drupal interface may be provided by:','','7.50'),(3727,'/nl/admin/modules','default','Translating within your site, using the Locale module\'s integrated <a href=\'@translate\'>translation interface</a>.','','7.50'),(3728,'/nl/admin/modules','default','Importing files from a set of existing translations, known as a translation package. A translation package enables the display of a specific version of Drupal in a specific language, and contains files in the Gettext Portable Object (<em>.po</em>) format. Although not all languages are available for every version of Drupal, translation packages for many languages are available for download from the <a href=\"@translations\">Drupal translations page</a>.','','7.50'),(3729,'/nl/admin/modules','default','If an existing translation package does not meet your needs, the Gettext Portable Object (<em>.po</em>) files within a package may be modified, or new <em>.po</em> files may be created, using a desktop Gettext editor. The Locale module\'s <a href=\'@import\'>import</a> feature allows the translated strings from a new or modified <em>.po</em> file to be added to your site. The Locale module\'s <a href=\'@export\'>export</a> feature generates files from your site\'s translated strings, that can either be shared with others or edited offline by a Gettext translation editor.','','7.50'),(3730,'/nl/admin/modules','default','Configuring a multilingual site','','7.50'),(3731,'/nl/admin/modules','default','Language negotiation allows your site to automatically change language based on the domain or path used for each request. Users may (optionally) select their preferred language on their <em>My account</em> page, and your site can be configured to honor a web browser\'s preferred language settings. Site content can be translated using the <a href=\'@content-help\'>Content translation module</a>.','','7.50'),(3732,'/nl/admin/modules','default','Adds language handling functionality and enables the translation of the user interface to languages other than English.','','7.50'),(3733,'/nl/admin/modules','default','The location module allows you to associate a geographic location with content and users. Users can do proximity searches by postal code.  This is useful for organizing communities that have a geographic presence.','','7.50'),(3734,'/nl/admin/modules','default','To administer locative information for content, use the content type administration page.  To support most location enabled features, you will need to install the country specific include file.  To support postal code proximity searches for a particular country, you will need a database dump of postal code data for that country.  As of June 2007 only U.S. and German postal codes are supported.','','7.50'),(3735,'/nl/admin/modules','default','<p>You can</p>\n          <ul>\n          <li>administer locative information at <a href=\"@admin-node-configure-types\">Administer &gt;&gt; Content management &gt;&gt; Content types</a> to configure a type and see the locative information.</li>\n          <li>administer location at <a href=\"@admin-settings-location\">Administer &gt;&gt; Site configuration &gt;&gt; Location</a>.</li>\n          <li>use a database dump for a U.S. and/or German postal codes table that can be found at <a href=\"@external-http-cvs-drupal-org\">zipcode database</a>.</li>\n          ','','7.50'),(3736,'/nl/admin/modules','default','For more information read the configuration and customization handbook <a href=\"@location\">Location page</a>.','','7.50'),(3737,'/nl/admin/modules','default','Adds a \'Find Address\' button to all location fields that use gmap','','7.50'),(3738,'/nl/admin/modules','default','Allows you to quickly add locations directly from a node without having to click \'edit\' first.','','7.50'),(3739,'/nl/admin/modules','default','Fill up all locations with lat&lon data','','7.50'),(3740,'/nl/admin/modules','default','Defines a Location field type.','','7.50'),(3741,'/nl/admin/modules','default','Allows you to add an email address to a location.','','7.50'),(3742,'/nl/admin/modules','default','Provide information about Location field to Entity module.','','7.50'),(3743,'/nl/admin/modules','default','Allows you to add a fax number to a location.','','7.50'),(3744,'/nl/admin/modules','default','Bulk assign random latitude and longitudes to nodes.','','7.50'),(3745,'/nl/admin/modules','default','Allows you to add a phone number to a location.','','7.50'),(3746,'/nl/admin/modules','default','Advanced search page for locations.','','7.50'),(3747,'/nl/admin/modules','default','Associate locations with taxonomy terms.','','7.50'),(3748,'/nl/admin/modules','default','Allows you to add a www adress to a location.','','7.50'),(3749,'/nl/admin/modules','default','MailChimp email service integration.','','7.50'),(3750,'/nl/admin/modules','default','View activity for an email address associated with any entity.','','7.50'),(3751,'/nl/admin/modules','default','Create, send and import MailChimp campaigns.','','7.50'),(3752,'/nl/admin/modules','default','Manage and integrate MailChimp lists.','','7.50'),(3753,'/nl/admin/modules','default','Manage MailChimp signup blocks and pages.','','7.50'),(3754,'/nl/admin/modules','default','The Menu module provides an interface for managing menus. A menu is a hierarchical collection of links, which can be within or external to the site, generally used for navigation. Each menu is rendered in a block that can be enabled and positioned through the <a href=\"@blocks\">Blocks administration page</a>. You can view and manage menus on the <a href=\"@menus\">Menus administration page</a>. For more information, see the online handbook entry for the <a href=\"@menu\">Menu module</a>.','','7.50'),(3755,'/nl/admin/modules','default','Managing menus','','7.50'),(3756,'/nl/admin/modules','default','Users with the <em>Administer menus and menu items</em> permission can add, edit and delete custom menus on the <a href=\"@menu\">Menus administration page</a>. Custom menus can be special site menus, menus of external links, or any combination of internal and external links. You may create an unlimited number of additional menus, each of which will automatically have an associated block. By selecting <em>list links</em>, you can add, edit, or delete links for a given menu. The links listing page provides a drag-and-drop interface for controlling the order of links, and creating a hierarchy within the menu.','','7.50'),(3757,'/nl/admin/modules','default','Displaying menus','','7.50'),(3758,'/nl/admin/modules','default','After you have created a menu, you must enable and position the associated block on the <a href=\"@blocks\">Blocks administration page</a>.','','7.50'),(3759,'/nl/admin/modules','default','Allows administrators to customize the site navigation menu.','','7.50'),(3760,'/nl/admin/modules','default','Adding menu blocks','','7.50'),(3761,'/nl/admin/modules','default','To add new menu blocks, use the \"<a href=\"!add-url\">Add menu block</a>\" link on the <a href=\"!block-url\">administer blocks page</a>. You will then be able to configure your menu block before adding it.','','7.50'),(3762,'/nl/admin/modules','default','Configuring menu blocks','','7.50'),(3763,'/nl/admin/modules','default','When adding or configuring a menu block, several configuration options are available:','','7.50'),(3764,'/nl/admin/modules','default','Basic options','','7.50'),(3765,'/nl/admin/modules','default','For menu trees that start with the 1st level, the default block title will be the menu name. For menu trees that start with the 2nd level or deeper, the default block title will be the title for the parent menu item of the specified level.','','7.50'),(3766,'/nl/admin/modules','default','For example, if the active menu trail for the Mangement menu is: Administer › Structure › Menus › Main menu, then a menu block configured to start with the 1st level of the Management menu will display a block title of “Management”. And a menu block configured to start with the 3rd level of the Management menu will display a block title of “Structure”.','','7.50'),(3767,'/nl/admin/modules','default','Block title as link','','7.50'),(3768,'/nl/admin/modules','default','For menu trees that start with the 2nd level or deeper, the default block title will be the title for the parent menu item of the specified level. If this option is checked, the block title will be a link to that menu item.','','7.50'),(3769,'/nl/admin/modules','default','To help identify the block on the administer blocks page, you can specify a unique title to be used on that page. If blank, the regular title will be used.','','7.50'),(3770,'/nl/admin/modules','default','Menu name','','7.50'),(3771,'/nl/admin/modules','default','Select the menu to use for the tree of links.','','7.50'),(3772,'/nl/admin/modules','default','Starting level','','7.50'),(3773,'/nl/admin/modules','default','Blocks that start with the 1st level will always be visible. Blocks that start with the 2nd level or deeper will only be visible when the trail to the active menu item is in the block’s tree.','','7.50'),(3774,'/nl/admin/modules','default','Maximum depth','','7.50'),(3775,'/nl/admin/modules','default','From the starting level, specify the maximum depth of the tree. Blocks with a maximum depth of 1 will just be a single un-nested list of links with none of those links’ children displayed.','','7.50'),(3776,'/nl/admin/modules','default','Advanced options','','7.50'),(3777,'/nl/admin/modules','default','Make the starting level follow the active menu item','','7.50'),(3778,'/nl/admin/modules','default','If the active menu item is deeper than the level specified above, the starting level will follow the active menu item. Otherwise, the starting level of the tree will remain fixed.','','7.50'),(3779,'/nl/admin/modules','default','Expand all children','','7.50'),(3780,'/nl/admin/modules','default','All children of this menu will be expanded.','','7.50'),(3781,'/nl/admin/modules','default','Sort','','7.50'),(3782,'/nl/admin/modules','default','Sort each item in the active trail to the top of its level. When used on a deep or wide menu tree, the active menu item’s children will be easier to see when the page is reloaded.','','7.50'),(3783,'/nl/admin/modules','default','Fixed parent item','','7.50'),(3784,'/nl/admin/modules','default','If you select a specific menu item, you alter the “starting level” and “maximum depth” options to be relative to the fixed parent item. The tree of links will only contain children of the selected parent item.','','7.50'),(3785,'/nl/admin/modules','default','Styling menu blocks','','7.50'),(3786,'/nl/admin/modules','default','Themers should be aware of the myriad of classes, templates and theme functions available to them. See the <a href=\"!url\">online documentation</a> or the README.txt file for detailed information about each of them.','','7.50'),(3787,'/nl/admin/modules','default','Menu block API','','7.50'),(3788,'/nl/admin/modules','default','Developers can use the API of this module to create their own menu trees outside the confines of blocks. All of the publicly available API functions are documented in the menu_block.module file.','','7.50'),(3789,'/nl/admin/modules','default','In addition, Menu block implements HOOK_get_menus() and HOOK_menu_block_tree_alter(). See menu_block.api.php for documentation.','','7.50'),(3790,'/nl/admin/modules','default','Provides configurable blocks of menu items.','','7.50'),(3791,'/nl/admin/modules','default','Provides export interface for Menu block module.','','7.50'),(3792,'/nl/admin/modules','default','Improved interface for menu editing.','','7.50'),(3793,'/nl/admin/modules','default','Menu item placeholders for node creation.','','7.50'),(3794,'/nl/admin/modules','default','Autocomplete for Menu Editor path field.','','7.50'),(3795,'/nl/admin/modules','default','This module adds support for multilingual menus. You can setup multilingual options for each menu:','','7.50'),(3796,'/nl/admin/modules','default','Menus can be fully multilingual with translatable (or localized) menu items.','','7.50'),(3797,'/nl/admin/modules','default','Menus can be configured to have a fixed language. All menu items share this language setting and the menu will be visible in that language only.','','7.50'),(3798,'/nl/admin/modules','default','Menus can also be configured to have no translations.','','7.50'),(3799,'/nl/admin/modules','default','The multilingual options of a menu must be configured before individual menu items can be translated. Go to the <a href=\"@menu-admin\">Menus administration page</a> and follow the \"edit menu\" link to the menu in question.','','7.50'),(3800,'/nl/admin/modules','default','Supports translatable custom menu items.','','7.50'),(3801,'/nl/admin/modules','default','The Metatag module provides a options to let each page have customized meta data added to the \"meta\" tags in the HEAD section of the document.','','7.50'),(3802,'/nl/admin/modules','default','Adds support and an API to implement meta tags.','','7.50'),(3803,'/nl/admin/modules','default','Import data from other modules into Metatag.','','7.50'),(3804,'/nl/admin/modules','default','Provides support for applinks.org meta tags.','','7.50'),(3805,'/nl/admin/modules','default','Assigned Metatag using Context definitions, allowing them to be assigned by path and other criteria.','','7.50'),(3806,'/nl/admin/modules','default','Provides development / debugging functionality for the Metatag module. Integrates with Devel Generate.','','7.50'),(3807,'/nl/admin/modules','default','Provides the fifteen <a href=\"http://dublincore.org/documents/dces/\">Dublin Core Metadata Element Set 1.1</a> meta tags from the <a href=\"http://dublincore.org/\">Dublin Core Metadata Institute</a>.','','7.50'),(3808,'/nl/admin/modules','default','Provides forty additional meta tags from the <a href=\"http://dublincore.org/\">Dublin Core Metadata Institute</a>.','','7.50'),(3809,'/nl/admin/modules','default','Provides support for Facebook\'s custom meta tags.','','7.50'),(3810,'/nl/admin/modules','default','Provides support for custom favicons.','','7.50'),(3811,'/nl/admin/modules','default','Provides support for Google+ \'itemscope\' meta tags.','','7.50'),(3812,'/nl/admin/modules','default','Provides support for the hreflang meta tag with some extra logic to simplify it.','','7.50'),(3813,'/nl/admin/modules','default','Provides support for meta tags used to control the mobile browser experience.','','7.50'),(3814,'/nl/admin/modules','default','Provides support for Open Graph Protocol meta tags.','','7.50'),(3815,'/nl/admin/modules','default','Provides Metatag integration within the Panels interface.','','7.50'),(3816,'/nl/admin/modules','default','Provides support for Twitter\'s Card meta tags.','','7.50'),(3817,'/nl/admin/modules','default','Various meta tags for verifying ownership of a site.','','7.50'),(3818,'/nl/admin/modules','default','Provides Metatag integration within the Views interface.','','7.50'),(3819,'/nl/admin/modules','default','Provides additional Open Graph Protocol meta tags for describing products.','','7.50'),(3820,'/nl/admin/modules','default','Filter the modules list.','','7.50'),(3821,'/nl/admin/modules','default','Provides some extended multilingual options for nodes.','','7.50'),(3822,'/nl/admin/modules','default','Additionally, if <em>String translation</em> enabled, this module will localize all content type configuration texts.','','7.50'),(3823,'/nl/admin/modules','default','Content type names','','7.50'),(3824,'/nl/admin/modules','default','Submission guidelines','','7.50'),(3825,'/nl/admin/modules','default','Content type descriptions were previously localized so they won\'t be affected.','','7.50'),(3826,'/nl/admin/modules','default','Extended node options for multilingual content','','7.50'),(3827,'/nl/admin/modules','default','Enables multilingual forum, translates names and containers.','','7.50'),(3828,'/nl/admin/modules','default','API module for multilingual content selection','','7.50'),(3829,'/nl/admin/modules','default','The Node module manages the creation, editing, deletion, settings, and display of the main site content. Content items managed by the Node module are typically displayed as pages on your site, and include a title, some meta-data (author, creation time, content type, etc.), and optional fields containing text or other data (fields are managed by the <a href=\"@field\">Field module</a>). For more information, see the online handbook entry for <a href=\"@node\">Node module</a>.','','7.50'),(3830,'/nl/admin/modules','default','Creating content','','7.50'),(3831,'/nl/admin/modules','default','When new content is created, the Node module records basic information about the content, including the author, date of creation, and the <a href=\"@content-type\">Content type</a>. It also manages the <em>publishing options</em>, which define whether or not the content is published, promoted to the front page of the site, and/or sticky at the top of content lists. Default settings can be configured for each <a href=\"@content-type\">type of content</a> on your site.','','7.50'),(3832,'/nl/admin/modules','default','Creating custom content types','','7.50'),(3833,'/nl/admin/modules','default','The Node module gives users with the <em>Administer content types</em> permission the ability to <a href=\"@content-new\">create new content types</a> in addition to the default ones already configured. Creating custom content types allows you the flexibility to add <a href=\"@field\">fields</a> and configure default settings that suit the differing needs of various site content.','','7.50'),(3834,'/nl/admin/modules','default','Administering content','','7.50'),(3835,'/nl/admin/modules','default','The <a href=\"@content\">Content administration page</a> allows you to review and bulk manage your site content.','','7.50'),(3836,'/nl/admin/modules','default','Creating revisions','','7.50'),(3837,'/nl/admin/modules','default','The Node module also enables you to create multiple versions of any content, and revert to older versions using the <em>Revision information</em> settings.','','7.50'),(3838,'/nl/admin/modules','default','User permissions','','7.50'),(3839,'/nl/admin/modules','default','The Node module makes a number of permissions available for each content type, which can be set by role on the <a href=\"@permissions\">permissions page</a>.','','7.50'),(3840,'/nl/admin/modules','default','Allows content to be submitted to the site and displayed on pages.','','7.50'),(3841,'/nl/admin/modules','default','Allows assigning CSS classes to nodes.','','7.50'),(3842,'/nl/admin/modules','default','Associate locations with nodes.','','7.50'),(3843,'/nl/admin/modules','default','The Number module defines various numeric field types for the Field module. Numbers can be in integer, decimal, or floating-point form, and they can be formatted when displayed. Number fields can be limited to a specific set of input values or to a range of values. See the <a href=\"@field-help\">Field module help page</a> for more information about fields.','','7.50'),(3844,'/nl/admin/modules','default','Defines numeric field types.','','7.50'),(3845,'/nl/admin/modules','default','Allows users to log into your site using OpenID.','','7.50'),(3846,'/nl/admin/modules','default','The Options module defines checkbox, selection, and other input widgets for the Field module. See the <a href=\"@field-help\">Field module help page</a> for more information about fields.','','7.50'),(3847,'/nl/admin/modules','default','Defines selection, check box and radio button widgets for text and numeric fields.','','7.50'),(3848,'/nl/admin/modules','default','Displays the Drupal administration interface in an overlay.','','7.50'),(3849,'/nl/admin/modules','default','Provides a UI and API to manage pages within the site.','','7.50'),(3850,'/nl/admin/modules','default','Paragraphs module to control your content flow.','','7.50'),(3851,'/nl/admin/modules','default','Allow paragraph bundles to be duplicate for translation.','','7.50'),(3852,'/nl/admin/modules','default','Add view / create / update / delete permissions for all paragraph bundles.','','7.50'),(3853,'/nl/admin/modules','default','The Path module allows you to specify an alias, or custom URL, for any existing internal system path. Aliases should not be confused with URL redirects, which allow you to forward a changed or inactive URL to a new URL. In addition to making URLs more readable, aliases also help search engines index content more effectively. Multiple aliases may be used for a single internal system path. To automate the aliasing of paths, you can install the contributed module <a href=\"@pathauto\">Pathauto</a>. For more information, see the online handbook entry for the <a href=\"@path\">Path module</a>.','','7.50'),(3854,'/nl/admin/modules','default','Creating aliases','','7.50'),(3855,'/nl/admin/modules','default','Users with sufficient <a href=\"@permissions\">permissions</a> can create aliases under the <em>URL path settings</em> section when they create or edit content. Some examples of aliases are: ','','7.50'),(3856,'/nl/admin/modules','default','<em>member/jane-smith</em> aliased to internal path <em>user/123</em>','','7.50'),(3857,'/nl/admin/modules','default','<em>about-us/team</em> aliased to internal path <em>node/456</em>','','7.50'),(3858,'/nl/admin/modules','default','Managing aliases','','7.50'),(3859,'/nl/admin/modules','default','The Path module provides a way to search and view a <a href=\"@aliases\">list of all aliases</a> that are in use on your website. Aliases can be added, edited and deleted through this list.','','7.50'),(3860,'/nl/admin/modules','default','Allows users to rename URLs.','','7.50'),(3861,'/nl/admin/modules','default','Define translations for generic paths','','7.50'),(3862,'/nl/admin/modules','default','Provides a mechanism for modules to automatically generate aliases for the content they manage.','','7.50'),(3863,'/nl/admin/modules','default','Maximum alias and component length','','7.50'),(3864,'/nl/admin/modules','default','The <strong>maximum alias length</strong> and <strong>maximum component length</strong> values default to 100 and have a limit of @max from Pathauto. This length is limited by the length of the \"alias\" column of the url_alias database table. The default database schema for this column is @max. If you set a length that is equal to that of the one set in the \"alias\" column it will cause problems in situations where the system needs to append additional words to the aliased URL. You should enter a value that is the length of the \"alias\" column minus the length of any strings that might get added to the end of the URL. The length of strings that might get added to the end of your URLs depends on which modules you have enabled and on your Pathauto settings. The recommended and default value is 100.','','7.50'),(3865,'/nl/admin/modules','default','Allows embedded PHP code/snippets to be evaluated.','','7.50'),(3866,'/nl/admin/modules','default','Allows your site to capture votes on different topics in the form of multiple choice questions.','','7.50'),(3867,'/nl/admin/modules','default','A jQuery based override of Drupal\'s core message system','','7.50'),(3868,'/nl/admin/modules','default','The RDF module enriches your content with metadata to let other applications (e.g., search engines, aggregators, and so on) better understand its relationships and attributes. This semantically enriched, machine-readable output for Drupal sites uses the <a href=\"@rdfa\">RDFa specification</a> which allows RDF data to be embedded in HTML markup. Other modules can define mappings of their data to RDF terms, and the RDF module makes this RDF data available to the theme. The core Drupal modules define RDF mappings for their data model, and the core Drupal themes output this RDF metadata information along with the human-readable visual information. For more information, see the online handbook entry for <a href=\"@rdf\">RDF module</a>.','','7.50'),(3869,'/nl/admin/modules','default','Enriches your content with metadata to let other applications (e.g. search engines, aggregators) better understand its relationships and attributes.','','7.50'),(3870,'/nl/admin/modules','default','Protect your website from spam and abuse while letting real people pass through with ease.','','7.50'),(3871,'/nl/admin/modules','default','Replicate provide an API to replicate (duplicate) entities. This modules also provide hooks to control exactly how parts of an entity are duplicated.','','7.50'),(3872,'/nl/admin/modules','default','Extends Replicate module to manage the replication of paragraph_item fields.','','7.50'),(3873,'/nl/admin/modules','default','Replicate UI provides integration for Replicate with front-end site builder modules like VBO.','','7.50'),(3874,'/nl/admin/modules','default','Responsify any menu using CSS Selectors.','','7.50'),(3875,'/nl/admin/modules','default','The Search module provides the ability to index and search for content by exact keywords, and for users by username or e-mail. For more information, see the online handbook entry for <a href=\"@search-module\">Search module</a>.','','7.50'),(3876,'/nl/admin/modules','default','Searching content and users','','7.50'),(3877,'/nl/admin/modules','default','Users with <em>Use search</em> permission can use the search block and <a href=\"@search\">Search page</a>. Users with the <em>View published content</em> permission can search for content containing exact keywords. Users with the <em>View user profiles</em> permission can search for users containing the keyword anywhere in the user name, and users with the <em>Administer users</em> permission can search for users by email address. Additionally, users with <em>Use advanced search</em> permission can find content using more complex search methods and filtering by choosing the <em>Advanced search</em> option on the <a href=\"@search\">Search page</a>.','','7.50'),(3878,'/nl/admin/modules','default','Indexing content with cron','','7.50'),(3879,'/nl/admin/modules','default','To provide keyword searching, the search engine maintains an index of words found in the content and its fields, along with text added to your content by other modules (such as comments from the core Comment module, and taxonomy terms from the core Taxonomy module). To build and maintain this index, a correctly configured <a href=\"@cron\">cron maintenance task</a> is required. Users with <em>Administer search</em> permission can further configure the cron settings on the <a href=\"@searchsettings\">Search settings page</a>.','','7.50'),(3880,'/nl/admin/modules','default','Content reindexing','','7.50'),(3881,'/nl/admin/modules','default','Content-related actions on your site (creating, editing, or deleting content and comments) automatically cause affected content items to be marked for indexing or reindexing at the next cron run. When content is marked for reindexing, the previous content remains in the index until cron runs, at which time it is replaced by the new content. Unlike content-related actions, actions related to the structure of your site do not cause affected content to be marked for reindexing. Examples of structure-related actions that affect content include deleting or editing taxonomy terms, enabling or disabling modules that add text to content (such as Taxonomy, Comment, and field-providing modules), and modifying the fields or display parameters of your content types. If you take one of these actions and you want to ensure that the search index is updated to reflect your changed site structure, you can mark all content for reindexing by clicking the \"Re-index site\" button on the <a href=\"@searchsettings\">Search settings page</a>. If you have a lot of content on your site, it may take several cron runs for the content to be reindexed.','','7.50'),(3882,'/nl/admin/modules','default','Configuring search settings','','7.50'),(3883,'/nl/admin/modules','default','Indexing behavior can be adjusted using the <a href=\"@searchsettings\">Search settings page</a>. Users with <em>Administer search</em> permission can control settings such as the <em>Number of items to index per cron run</em>, <em>Indexing settings</em> (word length), <em>Active search modules</em>, and <em>Content ranking</em>, which lets you adjust the priority in which indexed content is returned in results.','','7.50'),(3884,'/nl/admin/modules','default','Search block','','7.50'),(3885,'/nl/admin/modules','default','The Search module includes a default <em>Search form</em> block, which can be enabled and configured on the <a href=\"@blocks\">Blocks administration page</a>. The block is available to users with the <em>Search content</em> permission.','','7.50'),(3886,'/nl/admin/modules','default','Extending Search module','','7.50'),(3887,'/nl/admin/modules','default','By default, the Search module only supports exact keyword matching in content searches. You can modify this behavior by installing a language-specific stemming module for your language (such as <a href=\"http://drupal.org/project/porterstemmer\">Porter Stemmer</a> for American English), which allows words such as walk, walking, and walked to be matched in the Search module. Another approach is to use a third-party search technology with stemming or partial word matching features built in, such as <a href=\"http://drupal.org/project/apachesolr\">Apache Solr</a> or <a href=\"http://drupal.org/project/sphinx\">Sphinx</a>. These and other <a href=\"@contrib-search\">search-related contributed modules</a> can be downloaded by visiting Drupal.org.','','7.50'),(3888,'/nl/admin/modules','default','Enables site-wide keyword searching.','','7.50'),(3889,'/nl/admin/modules','default','The Shortcut module allows users to create sets of <em>shortcut</em> links to commonly-visited pages of the site. Shortcuts are contained within <em>sets</em>. Each user with <em>Select any shortcut set</em> permission can select a shortcut set created by anyone at the site. For more information, see the online handbook entry for <a href=\"@shortcut\">Shortcut module</a>.','','7.50'),(3890,'/nl/admin/modules','default','Administering shortcuts','','7.50'),(3891,'/nl/admin/modules','default','Users with the <em>Administer shortcuts</em> permission can manage shortcut sets and edit the shortcuts within sets from the <a href=\"@shortcuts\">Shortcuts administration page</a>.','','7.50'),(3892,'/nl/admin/modules','default','Choosing shortcut sets','','7.50'),(3893,'/nl/admin/modules','default','Users with permission to switch shortcut sets can choose a shortcut set to use from the Shortcuts tab of their user account page.','','7.50'),(3894,'/nl/admin/modules','default','Adding and removing shortcuts','','7.50'),(3895,'/nl/admin/modules','default','The Shortcut module creates an add/remove link for each page on your site; the link lets you add or remove the current page from the currently-enabled set of shortcuts (if your theme displays it and you have permission to edit your shortcut set). The core Seven administration theme displays this link next to the page title, as a small + or - sign. If you click on the + sign, you will add that page to your preferred set of shortcuts. If the page is already part of your shortcut set, the link will be a - sign, and will allow you to remove the current page from your shortcut set.','','7.50'),(3896,'/nl/admin/modules','default','Displaying shortcuts','','7.50'),(3897,'/nl/admin/modules','default','You can display your shortcuts by enabling the Shortcuts block on the <a href=\"@blocks\">Blocks administration page</a>. Certain administrative modules also display your shortcuts; for example, the core <a href=\"@toolbar-help\">Toolbar module</a> displays them near the top of the page, along with an <em>Edit shortcuts</em> link.','','7.50'),(3898,'/nl/admin/modules','default','Allows users to manage customizable lists of shortcut links.','','7.50'),(3899,'/nl/admin/modules','default','This module creates a new text field formatter. There are no global configuration options.','','7.50'),(3900,'/nl/admin/modules','default','Provides a more robust alternative to \"summary or trimmed\" textfield format','','7.50'),(3901,'/nl/admin/modules','default','Logs access statistics for your site.','','7.50'),(3902,'/nl/admin/modules','default','Provides a quick and easy way of replacing text.','','7.50'),(3903,'/nl/admin/modules','default','Tools for importing and exporting string override settings.','','7.50'),(3904,'/nl/admin/modules','default','This module adds support for other modules to translate user defined strings. Depending on which modules you have enabled that use this feature you may see different text groups to translate.','','7.50'),(3905,'/nl/admin/modules','default','This works differently to Drupal standard localization system: The strings will be translated from the <a href=\"@configure-strings\">source language</a>, which defaults to the site default language (it may not be English), so changing the default language may cause all these translations to be broken.','','7.50'),(3906,'/nl/admin/modules','default','If you are missing strings to translate, use the <a href=\"@refresh-strings\">refresh strings</a> page.','','7.50'),(3907,'/nl/admin/modules','default','Read more on the <em>Internationalization handbook</em>: <a href=\"http://drupal.org/node/313293\">Translating user defined strings</a>.','','7.50'),(3908,'/nl/admin/modules','default','Provides support for translation of user defined strings.','','7.50'),(3909,'/nl/admin/modules','default','Create custom styles for applications such as Panels.','','7.50'),(3910,'/nl/admin/modules','default','This module synchronizes content taxonomy and fields accross translations:','','7.50'),(3911,'/nl/admin/modules','default','First you need to select which fields should be synchronized. Then, after a node has been updated, all enabled vocabularies and fields will be synchronized as follows:','','7.50'),(3912,'/nl/admin/modules','default','All the node fields selected for synchronization will be set to the same value for all translations.','','7.50'),(3913,'/nl/admin/modules','default','For multilingual vocabularies, the terms for all translations will be replaced by the translations of the original node terms.','','7.50'),(3914,'/nl/admin/modules','default','For other vocabularies, the terms will be just copied over to all the translations.','','7.50'),(3915,'/nl/admin/modules','default','Note that permissions are not checked for each node. So if someone can edit a node and it is set to synchronize, all the translations will be synchronized anyway.','','7.50'),(3916,'/nl/admin/modules','default','To enable synchronization check content type options to select which fields to synchronize for each node type.','','7.50'),(3917,'/nl/admin/modules','default','The list of available fields for synchronization will include some standard node fields and all CCK fields. You can add more fields to the list in a configuration variable. See README.txt for how to do it.','','7.50'),(3918,'/nl/admin/modules','default','Synchronizes taxonomy and fields accross translations of the same content.','','7.50'),(3919,'/nl/admin/modules','default','Logs and records system events to syslog.','','7.50'),(3920,'/nl/admin/modules','default','The System module is integral to the site, and provides basic but extensible functionality for use by other modules and themes. Some integral elements of Drupal are contained in and managed by the System module, including caching, enabling and disabling modules and themes, preparing and displaying the administrative page, and configuring fundamental site settings. A number of key system maintenance operations are also part of the System module. For more information, see the online handbook entry for <a href=\"@system\">System module</a>.','','7.50'),(3921,'/nl/admin/modules','default','Managing modules','','7.50'),(3922,'/nl/admin/modules','default','The System module allows users with the appropriate permissions to enable and disable modules on the <a href=\"@modules\">Modules administration page</a>. Drupal comes with a number of core modules, and each module provides a discrete set of features and may be enabled or disabled depending on the needs of the site. Many additional modules contributed by members of the Drupal community are available for download at the <a href=\"@drupal-modules\">Drupal.org module page</a>.','','7.50'),(3923,'/nl/admin/modules','default','Managing themes','','7.50'),(3924,'/nl/admin/modules','default','The System module allows users with the appropriate permissions to enable and disable themes on the <a href=\"@themes\">Appearance administration page</a>. Themes determine the design and presentation of your site. Drupal comes packaged with several core themes, and additional contributed themes are available at the <a href=\"@drupal-themes\">Drupal.org theme page</a>.','','7.50'),(3925,'/nl/admin/modules','default','Managing caching','','7.50'),(3926,'/nl/admin/modules','default','The System module allows users with the appropriate permissions to manage caching on the <a href=\'@cache-settings\'>Performance settings page</a>. Drupal has a robust caching system that allows the efficient re-use of previously-constructed web pages and web page components. Pages requested by anonymous users are stored in a compressed format; depending on your site configuration and the amount of your web traffic tied to anonymous visitors, the caching system may significantly increase the speed of your site.','','7.50'),(3927,'/nl/admin/modules','default','Performing system maintenance','','7.50'),(3928,'/nl/admin/modules','default','In order for the site and its modules to continue to operate well, a set of routine administrative operations must run on a regular basis. The System module manages this task by making use of a system cron job. You can verify the status of cron tasks by visiting the <a href=\"@status\">Status report page</a>. For more information, see the online handbook entry for <a href=\"@handbook\">configuring cron jobs</a>. You can set up cron job by visiting <a href=\"@cron\">Cron configuration</a> page','','7.50'),(3929,'/nl/admin/modules','default','Configuring basic site settings','','7.50'),(3930,'/nl/admin/modules','default','The System module also handles basic configuration options for your site, including <a href=\"@date-time-settings\">Date and time settings</a>, <a href=\"@file-system\">File system settings</a>, <a href=\"@clean-url\">Clean URL support</a>, <a href=\"@site-info\">Site name and other information</a>, and a <a href=\"@maintenance-mode\">Maintenance mode</a> for taking your site temporarily offline.','','7.50'),(3931,'/nl/admin/modules','default','Configuring actions','','7.50'),(3932,'/nl/admin/modules','default','Actions are individual tasks that the system can do, such as unpublishing a piece of content or banning a user. Modules, such as the <a href=\"@trigger-help\">Trigger module</a>, can fire these actions when certain system events happen; for example, when a new post is added or when a user logs in. Modules may also provide additional actions. Visit the <a href=\"@actions\">Actions page</a> to configure actions.','','7.50'),(3933,'/nl/admin/modules','default','Handles general site configuration for administrators.','','7.50'),(3934,'/nl/admin/modules','default','The Taxonomy module allows you to classify the content of your website. To classify content, you define <em>vocabularies</em> that contain related <em>terms</em>, and then assign the vocabularies to content types. For more information, see the online handbook entry for the <a href=\"@taxonomy\">Taxonomy module</a>.','','7.50'),(3935,'/nl/admin/modules','default','Creating vocabularies','','7.50'),(3936,'/nl/admin/modules','default','Users with sufficient <a href=\"@perm\">permissions</a> can create <em>vocabularies</em> and <em>terms</em> through the <a href=\"@taxo\">Taxonomy page</a>. The page listing the terms provides a drag-and-drop interface for controlling the order of the terms and sub-terms within a vocabulary, in a hierarchical fashion. A <em>controlled vocabulary</em> classifying music by genre with terms and sub-terms could look as follows:','','7.50'),(3937,'/nl/admin/modules','default','<em>vocabulary</em>: Music','','7.50'),(3938,'/nl/admin/modules','default','<em>term</em>: Jazz','','7.50'),(3939,'/nl/admin/modules','default','<em>sub-term</em>: Swing','','7.50'),(3940,'/nl/admin/modules','default','<em>sub-term</em>: Fusion','','7.50'),(3941,'/nl/admin/modules','default','<em>term</em>: Rock','','7.50'),(3942,'/nl/admin/modules','default','<em>sub-term</em>: Country rock','','7.50'),(3943,'/nl/admin/modules','default','<em>sub-term</em>: Hard rock','','7.50'),(3944,'/nl/admin/modules','default','You can assign a sub-term to multiple parent terms. For example, <em>fusion</em> can be assigned to both <em>rock</em> and <em>jazz</em>.','','7.50'),(3945,'/nl/admin/modules','default','Terms in a <em>free-tagging vocabulary</em> can be built gradually as you create or edit content. This is often done used for blogs or photo management applications.','','7.50'),(3946,'/nl/admin/modules','default','Assigning vocabularies to content types','','7.50'),(3947,'/nl/admin/modules','default','Before you can use a new vocabulary to classify your content, a new Taxonomy term field must be added to a <a href=\"@ctedit\">content type</a> on its <em>manage fields</em> page. When adding a taxonomy field, you choose a <em>widget</em> to use to enter the taxonomy information on the content editing page: a select list, checkboxes, radio buttons, or an auto-complete field (to build a free-tagging vocabulary). After choosing the field type and widget, on the subsequent <em>field settings</em> page you can choose the desired vocabulary, whether one or multiple terms can be chosen from the vocabulary, and other settings. The same vocabulary can be added to multiple content types, by using the \"Add existing field\" section on the manage fields page.','','7.50'),(3948,'/nl/admin/modules','default','Classifying content','','7.50'),(3949,'/nl/admin/modules','default','After the vocabulary is assigned to the content type, you can start classifying content. The field with terms will appear on the content editing screen when you edit or <a href=\"@addnode\">add new content</a>.','','7.50'),(3950,'/nl/admin/modules','default','Viewing listings and RSS feeds by term','','7.50'),(3951,'/nl/admin/modules','default','Each taxonomy term automatically provides a page listing content that has its classification, and a corresponding RSS feed. For example, if the taxonomy term <em>country rock</em> has the ID 123 (you can see this by looking at the URL when hovering on the linked term, which you can click to navigate to the listing page), then you will find this list at the path <em>taxonomy/term/123</em>. The RSS feed will use the path <em>taxonomy/term/123/feed</em> (the RSS icon for this term\'s listing will automatically display in your browser\'s address bar when viewing the listing page).','','7.50'),(3952,'/nl/admin/modules','default','Extending Taxonomy module','','7.50'),(3953,'/nl/admin/modules','default','There are <a href=\"@taxcontrib\">many contributed modules</a> that extend the behavior of the Taxonomy module for both display and organization of terms.','','7.50'),(3954,'/nl/admin/modules','default','Enables the categorization of content.','','7.50'),(3955,'/nl/admin/modules','default','This module adds support for multilingual taxonomy. You can set up multilingual options for each vocabulary:','','7.50'),(3956,'/nl/admin/modules','default','A language can be assigned globaly for a vocabulary.','','7.50'),(3957,'/nl/admin/modules','default','Different terms for each language with translation relationships.','','7.50'),(3958,'/nl/admin/modules','default','Terms can be common to all languages, but may be localized.','','7.50'),(3959,'/nl/admin/modules','default','Enables multilingual taxonomy.','','7.50'),(3960,'/nl/admin/modules','default','Controls access to context based upon term depth','','7.50'),(3961,'/nl/admin/modules','default','Provides a framework for unit and functional testing.','','7.50'),(3962,'/nl/admin/modules','default','The Text module defines various text field types for the Field module. A text field may contain plain text only, or optionally, may use Drupal\'s <a href=\'@filter-help\'>text filters</a> to securely manage HTML output. Text input fields may be either a single line (text field), multiple lines (text area), or for greater input control, a select box, checkbox, or radio buttons. If desired, the field can be validated, so that it is limited to a set of allowed values. See the <a href=\'@field-help\'>Field module help page</a> for more information about fields.','','7.50'),(3963,'/nl/admin/modules','default','Defines simple text field types.','','7.50'),(3964,'/nl/admin/modules','default','Provides a user interface for the Token API and some missing core tokens.','','7.50'),(3965,'/nl/admin/modules','default','Provides a toolbar that shows the top-level administration menu items and links from other modules.','','7.50'),(3966,'/nl/admin/modules','default','Enables tracking of recent content for users.','','7.50'),(3967,'/nl/admin/modules','default','Provides an overview of the translation status of the site\'s content.','','7.50'),(3968,'/nl/admin/modules','default','Redirect to translated page when available. SEO for multilingual sites.','','7.50'),(3969,'/nl/admin/modules','default','Simple translation sets API for generic objects','','7.50'),(3970,'/nl/admin/modules','default','UI for quick translation of dynamic strings.','','7.50'),(3971,'/nl/admin/modules','default','Converts non-latin text to US-ASCII and sanitizes file names.','','7.50'),(3972,'/nl/admin/modules','default','Enables actions to be fired on certain system events, such as when new content is created.','','7.50'),(3973,'/nl/admin/modules','default','@font-your-face provider with Typekit.com fonts.','','7.50'),(3974,'/nl/admin/modules','default','The Update manager module periodically checks for new versions of your site\'s software (including contributed modules and themes), and alerts administrators to available updates. In order to provide update information, anonymous usage statistics are sent to Drupal.org. If desired, you may disable the Update manager module from the <a href=\'@modules\'>Module administration page</a>. For more information, see the online handbook entry for <a href=\'@update\'>Update manager module</a>.','','7.50'),(3975,'/nl/admin/modules','default','The Update manager also allows administrators to update and install modules and themes through the administration interface.','','7.50'),(3976,'/nl/admin/modules','default','Checking for available updates','','7.50'),(3977,'/nl/admin/modules','default','A report of <a href=\"@update-report\">available updates</a> will alert you when new releases are available for download. You may configure options for the frequency for checking updates (which are performed during <a href=\"@cron\">cron</a> runs) and e-mail notifications at the <a href=\"@update-settings\">Update manager settings</a>  page.','','7.50'),(3978,'/nl/admin/modules','default','Performing updates through the user interface','','7.50'),(3979,'/nl/admin/modules','default','The Update manager module allows administrators to perform updates directly through the administration interface. At the top of the <a href=\"@modules_page\">modules</a> and <a href=\"@themes_page\">themes</a> pages you will see a link to update to new releases. This will direct you to the <a href=\"@update-page\">update page</a> where you see a listing of all the missing updates and confirm which ones you want to upgrade. From there, you are prompted for your FTP/SSH password, which then transfers the files into your Drupal installation, overwriting your old files. More detailed instructions can be found in the <a href=\"@update\">online handbook</a>.','','7.50'),(3980,'/nl/admin/modules','default','Installing new modules and themes through the user interface','','7.50'),(3981,'/nl/admin/modules','default','You can also install new modules and themes in the same fashion, through the <a href=\"@install\">install page</a>, or by clicking the <em>Install new module/theme</em> link at the top of the <a href=\"@modules_page\">modules</a> and <a href=\"@themes_page\">themes</a> pages. In this case, you are prompted to provide either the URL to the download, or to upload a packaged release file from your local computer.','','7.50'),(3982,'/nl/admin/modules','default','Checks for available updates, and can securely install or update modules and themes via a web interface.','','7.50'),(3983,'/nl/admin/modules','default','The User module allows users to register, log in, and log out. It also allows users with proper permissions to manage user roles (used to classify users) and permissions associated with those roles. For more information, see the online handbook entry for <a href=\"@user\">User module</a>.','','7.50'),(3984,'/nl/admin/modules','default','Creating and managing users','','7.50'),(3985,'/nl/admin/modules','default','The User module allows users with the appropriate <a href=\"@permissions\">permissions</a> to create user accounts through the <a href=\"@people\">People administration page</a>, where they can also assign users to one or more roles, and block or delete user accounts. If allowed, users without accounts (anonymous users) can create their own accounts on the <a href=\"@register\">Create new account</a> page.','','7.50'),(3986,'/nl/admin/modules','default','User roles and permissions','','7.50'),(3987,'/nl/admin/modules','default','<em>Roles</em> are used to group and classify users; each user can be assigned one or more roles. By default there are two roles: <em>anonymous user</em> (users that are not logged in) and <em>authenticated user</em> (users that are registered and logged in). Depending on choices you made when you installed Drupal, the installation process may have defined more roles, and you can create additional custom roles on the <a href=\"@roles\">Roles page</a>. After creating roles, you can set permissions for each role on the <a href=\"@permissions_user\">Permissions page</a>. Granting a permission allows users who have been assigned a particular role to perform an action on the site, such as viewing a particular type of content, editing or creating content, administering settings for a particular module, or using a particular function of the site (such as search).','','7.50'),(3988,'/nl/admin/modules','default','The <a href=\"@accounts\">Account settings page</a> allows you to manage settings for the displayed name of the anonymous user role, personal contact forms, user registration, and account cancellation. On this page you can also manage settings for account personalization (including signatures and user pictures), and adapt the text for the e-mail messages that are sent automatically during the user registration process.','','7.50'),(3989,'/nl/admin/modules','default','Manages the user registration and login system.','','7.50'),(3990,'/nl/admin/modules','default','Associate locations with users.','','7.50'),(3991,'/nl/admin/modules','default','Translate emails sent from the User module.','','7.50'),(3992,'/nl/admin/modules','default','Variable Information and basic variable API','','7.50'),(3993,'/nl/admin/modules','default','Variable Administration UI','','7.50'),(3994,'/nl/admin/modules','default','An example module showing how to use the Variable API and providing some variables.','','7.50'),(3995,'/nl/admin/modules','default','API to use variable realms from different modules','','7.50'),(3996,'/nl/admin/modules','default','Database storage for variable realms. This is an API module.','','7.50'),(3997,'/nl/admin/modules','default','Multilingual variables that switch language depending on page language.','','7.50'),(3998,'/nl/admin/modules','default','Provides views integration for variable, included a default variable argument.','','7.50'),(3999,'/nl/admin/modules','default','Defines a field type for referencing a view from a node.','','7.50'),(4000,'/nl/admin/modules','default','Create customized lists and queries from your database.','','7.50'),(4001,'/nl/admin/modules','default','Allows Views content to be used in Panels, Dashboard and other modules which use the CTools Content API.','','7.50'),(4002,'/nl/admin/modules','default','A pager plugin for views. Gives users the option to add a \'more\' button to a view and have the results appended to existing results being displayed.','','7.50'),(4003,'/nl/admin/modules','default','Administrative interface to views. Without this module, you cannot create or edit your views.','','7.50'),(4004,'/nl/admin/modules','default','Optional: Enable Webform on multiple types by visiting the <a href=\"!url\">Webform settings</a> page.','','7.50'),(4005,'/nl/admin/modules','default','<p>This module lets you create forms or questionnaires and define their content. Submissions from these forms are stored in the database and optionally also sent by e-mail to a predefined address.</p>\n      <p>Here is how to create one:</p>\n      <ul>\n        <li>!webform-types-message</li>\n        <li>Go to <a href=\"!create-content\">Create content</a> and add a !types piece of content.</li>\n        <li>After saving the new content, you will be redirected to the main field list of the form that will be created. Add the fields you would like on your form.</li>\n        <li>Once finished adding fields, you may want to send e-mails to administrators or back to the user who filled out the form. Click on the <em>Emails</em> sub-tab underneath the <em>Webform</em> tab on the piece of content.</li>\n        <li>Finally, visit the <em>Form settings</em> sub-tab under the <em>Webform</em> tab to configure remaining configurations options for your form.\n          <ul>\n          <li>Add a confirmation message and/or redirect URL that is to be displayed after successful submission.</li>\n          <li>Set a submission limit.</li>\n          <li>Determine which roles may submit the form.</li>\n          <li>Advanced configuration options such as allowing drafts or show users a message indicating how they can edit their submissions.</li>\n          </ul>\n        </li>\n        <li>Your form is now ready for viewing. After receiving submissions, you can check the results users have submitted by visiting the <em>Results</em> tab on the piece of content.</li>\n      </ul>\n      <p>Help on adding and configuring the components will be shown after you add your first component.</p>\n      ','','7.50'),(4006,'/nl/admin/modules','default','Enables the creation of forms and questionnaires.','','7.50'),(40