fault','Maximum number of files per operation','','7.50'),(6067,'/nl/admin/config/media/imce/profile/edit/1','default','You can allow users to select multiple files for operations such as delete, resize, etc. Entire batch file operation is executed in a single drupal load, which may be good. However there will be an increase in script execution time, cpu load and memory consumption possibly exceeding the limits of your server, which is really bad. For unlimited number of file handling, set this to 0.','','7.50'),(6068,'/nl/admin/config/media/imce/profile/edit/1','default','Including subdirectories','','7.50'),(6069,'/nl/admin/config/media/imce/profile/edit/1','default','Thumbnails','','7.50'),(6070,'/nl/admin/config/media/imce/profile/edit/1','default','root','','7.50'),(6071,'/nl/admin/config/media/imce/profile/edit/1','default','Directory path','','7.50'),(6072,'/nl/admin/config/media/imce/profile/edit/1','default','Directories','','7.50'),(6073,'/nl/admin/config/media/imce/profile/edit/1','default','Define directories that users of this profile can access.\n<ul>\n	<li>Use alphanumeric characters as directory paths.</li>\n	<li>To specify file system root, just enter <strong>.</strong>(dot) character.</li>\n	<li>Use <strong>%uid</strong> as a placeholder for user ID. Ex: <em>users/user%uid</em> creates directories such as <em>users/user1</em>, <em>users/user42</em>, etc.</li>\n  <li>To remove a directory from the list, leave the directory path blank.</li>\n  <li>If you want more flexibility in directory paths you can execute php to return a directory path.<br />\n  For php execution your directory path must start with <strong>php:</strong> and the rest must be a valid php code that is expected to return the actual directory path. <br />Ex: <strong>php: return \'users/\'.$user->name;</strong> defines <strong>users/USER-NAME</strong> as the directory path.<br />\n  A multi-level directory example <strong>php: return date(\'Y\', $user->created).\'/\'.date(\'m\', $user->created).\'/\'.$user->uid;</strong> defines <strong>MEMBERSHIP-YEAR/MONTH/USER-ID</strong> as the directory path, resulting in self-categorized user directories based on membership date.<br />\n  Note that you should use the $user variable instead of $GLOBALS[\'user\'] since they are not always the same object.</li>\n</ul>\n<p>Note that thumbnails permission does not affect thumbnail creation on upload. See thumbnails decription below.</p>\n<p>If you need more fields, just fill all and save, and you will get two more on the next page.</p>','','7.50'),(6074,'/nl/admin/config/media/imce/profile/edit/1','default','Dimensions','','7.50'),(6075,'/nl/admin/config/media/imce/profile/edit/1','default','You may create a list of thumbnail options that users can choose from.\n<ul>\n  <li>Use alphanumeric characters as thumbnail names.</li>\n  <li>Specify dimensions as <strong>WidthxHeight</strong>.</li>\n  <li>Prefix and suffix are strings that are added to original file name to create the thumbnail name.</li>\n  <li>An example thumbnail: Name = <strong>Small</strong>, Dimensions = <strong>80x80</strong>, Prefix = <strong>small_</strong></li>\n</ul>\n<p>Note that users will always be able to create these thumbnails on file upload no matter what the thumbnail permission is.</p>\n<p>If you need more fields, just fill all and save, and you will get two more on the next page.</p>','','7.50'),(6076,'/nl/admin/config/media/image-styles','default','Style name','','7.50'),(6077,'/nl/admin/config/media/image-styles','default','revert','','7.50'),(6078,'/nl/admin/config/media/image-styles','default','Image styles commonly provide thumbnail sizes by scaling and cropping images, but can also add various effects before an image is displayed. When an image is displayed with a style, a new file is created and the original image is left unchanged.','','7.50'),(6079,'/nl/admin/config/media/file-system','default','Public file system path','','7.50'),(6080,'/nl/admin/config/media/file-system',